import React from 'react';

import {Link} from 'react-router-dom';

import './status-filter.scss';

const StatusFilter =()=>{
    return (
      <div className="">
        <Link   to='/'
                type="button"
                className="filter-btn-all btn btn-info">All</Link>
        <Link   to='/active'
                type="button"
                className="filter-btn-active btn btn-outline-secondary">Active</Link>
        <Link   to='/done'
                type="button"
                className="filter-btn-done btn btn-outline-secondary">Done</Link>
      </div>
    );
}

export default StatusFilter;
